dbRow = {Title:"Agent/agente des finances (Nature de conséq A1)", WDNumber:"59482", Salary:"$54694 - $76725", Supervisory:"Yes", Classification:"FI-01", Link:"DND-FI-59936", Desc:"Ce poste fait typiquement partie du volet des FI- généraliste; toutefois, on peut également l’utiliser avec le volet des FI- spécialiste. \n\nCe poste est responsable pour assumer la responsabilité de fournir des conseils, une orientation et une analyse élémentaires au sujet de l’information financière et non financière concernant l’organisation ou le ministère. Conseiller et former les clients au sujet de l’application des politiques financières ainsi que des procédures, des directives, etc. concernant l’information financière et non financière. Posséder des connaissances élémentaires au sujet des politiques financières, des activités et des objectifs du ministère, et des principes et des pratiques ou méthodes administratifs.\n\nAssumer la responsabilité des activités dans l’une des catégories ci-dessous : \n\n• Planification et gestion des ressources : notamment la prestation de conseils, d’une orientation et de services financiers en planification et en établissement de budgets, de coûts et de rapports;\n• Élaboration des politiques et des systèmes : élaboration, mise en œuvre en application de politiques, de procédures et de contrôles, notamment l’élaboration, l’examen, l’essai et la tenue à jour de processus opérationnels, de procédures, de contrôles, de données et d’applications logicielles servant à la production de l’information financière et non financière;\n• Opérations comptables : comptabilisation et contrôle des charges et des produits, production de rapports financiers et enregistrement et suivi des opérations financières;\n• Autres (liste, c.-à-d. contrôles internes sur la gestion financière ou structure de gestion des ressources et des résultats ou budget principal des dépenses, CRG, etc.) : \n\nTypiquement, le ou la titulaire de ce poste relève d’un FI-03 ou d’un échelon supérieur ou d’un poste militaire. \n\nCe poste pourrait superviser le personnel civil ou militaire subalterne. \nNature de conséq: Degré A1\nImportance et nature des ressources: Jusqu’à 8,5 millions de dollards\nNiveau d’influence: 4 niveaux organiques ou plus à la personne chargée de prendre les decisions\n"};

databaseReturn.push(dbRow);

