dbRow = {Title:"Analyste en planification stratégique (1-3 junior)", WDNumber:"59612", Salary:"$67241 - $72660", Supervisory:"No", Classification:"AS-04", Link:"DND-PA-60059", Desc:"Le ou la titulaire du poste en cause a pour principales tâches d’effectuer des recherches et des analyses au soutien du cadre intégré de planification stratégique et de l’élaboration des plans intégrés opérationnels, d’activités et de ressources humaines ainsi que des rapports sur le rendement et des exposés de position destinés à l’organisme à l’aide de l’identification, du suivi et de l’analyse d’une grande variété d’influences et de renseignements complexes.\n\nCe poste traite principalement de la planification interne des programmes et des activités du gouvernement. Le ou la titulaire du poste en cause devra détenir certaines connaissances socio économiques et aptitudes d’analyse de base afin d’effectuer des analyses environnementales ou externes et de contribuer à l’élaboration de méthodologies d’analyse des renseignements socio économiques. Toutefois, ce poste n’exige pas des analyses et des recherches en profondeur nécessitant l’application d’une connaissance approfondie de l’économie, de la sociologie ou des statistiques pour effectuer des recherches économiques, socio-économiques ou sociologiques, des études, des prévisions, des enquêtes, ou encore pour établir, appliquer et évaluer des méthodes statistiques ou d’enquêtes et des indicateurs, ou pour développer, analyser et interpréter des renseignements qualitatifs et quantitatifs. \n\nLe poste en cause relève d’un poste hiérarchiquement plus élevé. \n\nLe ou la titulaire du poste en cause pourrait avoir à superviser des subalternes."};

