dbRow = {Title:"Analyste principal", WDNumber:"0000058870", Salary:"$80,243-$101,048", Supervisory:"Yes", Classification:"EC-06", Link:"DND-EC-59424", Desc:"Le ministère de la Défense nationale du Canada (MDN) est le plus grand ministère fédéral. Il a été créé en vue de défendre les intérêts du Canada sur terre, en mer et dans les airs, tant au Canada qu’à l’étranger. Le Commandement du renseignement des Forces canadiennes (COMRENSFC) fournit aux Forces armées canadiennes (FAC), au ministère de la Défense nationale, au gouvernement du Canada et aux forces alliées des capacités, des produits et des services de renseignement crédibles, opportuns et intégrés pour faciliter la réalisation des objectifs du Canada en matière de sécurité nationale. La Direction du renseignement transnational et régional (DRTR) relève du COMRENSFC. La DRTR fournit aux FAC, au MDN et aux forces alliées un appui opportun, pertinent, coordonné et intégré en matière de renseignements de défense de toutes sources.\n\n"};

