dbRow = {Title:"Analyste principal/principale – Systèmes et équipement", WDNumber:"59716", Salary:"$86935 - $105608", Supervisory:"Yes", Classification:"EL-08", Link:"DND-EL-60157", Desc:"Le poste sujet (PS) est au ministère de la Défense nationale, Sous-ministre adjoint (Gestion de l’information) (SMA (GI)), Directeur général – Cyberspace (DG Cyber).\n\nLe titulaire du PS est responsable d’examiner et d’analyser les lacunes existantes dans la structure de biens, les systèmes et l’équipement; de mener des recherches et d’explorer les tendances et les développements relatifs aux technologies novatrices futures afin d’assurer la fiabilité, la disponibilité, la capacité future et l’interopérabilité du système ou des systèmes nationaux avec les pays alliés; d’analyser la pertinence et la faisabilité, d’élaborer et de fournir des conseils de spécialiste et des recommandations à l’appui de la planification pluriannuelle relativement à toute acquisition et intégration à l’échelle nationale d’équipement et de systèmes novateurs futurs.\n\nLe titulaire du PS élabore, recommande et présente des analyses de rentabilisation, fournit des conseils en matière de besoins relatifs aux ressources financières, matérielles et humaines, formule des recommandations en matière d’investissements en immobilisations; gère des projets et des plans, prépare de nouvelles politiques et directives concernant la technologie future, consulte les autres ministères, l’industrie de la défense, le milieu universitaire et les pays alliés.\n\nLe poste relève d’un gestionnaire principal ou d’un gestionnaire militaire et comporte un poste d’attache responsable de superviser une équipe multidisciplinaire.\n"};

