dbRow = {Title:"Comptable-contrôleur/comptable-contrôleuse (Nature de conséq A3)", WDNumber:"59494", Salary:"$66576 - $90314", Supervisory:"Yes", Classification:"FI-02", Link:"DND-FI-59948", Desc:"Ce poste fait partie du volet des FI généralistes, et se trouve généralement dans l’environnement de la fonction de contrôle.\n\nFournir des conseils, une orientation, des analyses et des recommandations de fonds concernant la gestion, le contrôle, la coordination et la prestation des pratiques ou des procédures opérationnelles financières. Planifier, coordonner et mettre en œuvre les politiques, les services et les activités de projet en matière de gestion financière de l’organisation de sorte à assurer l’harmonisation avec l’organisme central, le mandat du ministère et les priorités de l’organisation. Animer des séances d’information et élaborer des analyses, des breffages et des rapports. Réaliser des analyses coûts-avantages et des analyses des risques, et préparer les prévisions des dépenses.\n\nAssumer la responsabilité des activités dans l’une des catégories ci-dessous : \n\n• Planification et gestion des ressources : notamment la prestation de conseils, d’une orientation et de services financiers en planification et en établissement de budgets, de coûts et de rapports;\n• Élaboration des politiques et des systèmes : élaboration, mise en œuvre en application de politiques, de procédures et de contrôles, notamment l’élaboration, l’examen, l’essai et la tenue à jour de processus opérationnels, de procédures, de contrôles, de données et d’applications logicielles servant à la production de l’information financière et non financière;\n• Opérations comptables : comptabilisation et contrôle des charges et des produits, production de rapports financiers et enregistrement et suivi des opérations financières;\n• Autres (liste, c.-à-d. contrôles internes sur la gestion financière ou structure de gestion des ressources et des résultats ou budget principal des dépenses, CRG, etc.) : \n\nEn général, le ou la titulaire de ce poste relève d’un FI-03 ou d’un échelon supérieur, ou d’un militaire. \n\nLe ou la titulaire de ce poste peut également assumer des fonctions de supervision. \n\nNature de conséq: Degré A3\nImportance et nature des ressources: Plus de 85 millions de dollards jusqu’à 850 millions de dollards\nNiveau d’influence: 4 niveaux organiques ou plus à la personne chargée de prendre les décisions \n"};

databaseReturn.push(dbRow);

