dbRow = {Title:"Coordonnateur de portefeuille (1-3 junior)", WDNumber:"59739", Salary:"$67241 - $72660", Supervisory:"Yes", Classification:"AS-04", Link:"DND-PA-60178", Desc:"Le poste sujet (PS) fournit des services liés à un ou plusieurs portefeuilles de programmes, et les évalue. Il recueil et analyse de l’information et des données et cerne des possibilités pour la résolution de problèmes, et fournit un soutien opérationnel a programme. Le PS participe aussi à l’élaboration et au maintien de l’assurance de la qualité; et analyse et évalue les méthodes employées pour mesurer la qualité des livrables des programmes.\n\nLe PS supervise de un à trois employés du niveau du soutien administratif.\n"};

