dbRow = {Title:"Coordonnateur de projet (11-25)", WDNumber:"0000059717", Salary:"$80274 - $86788", Supervisory:"Yes", Classification:"AS-05", Link:"DND-PA-60158", Desc:"Cette DEN est principalement responsable de la direction du développement et de la mise en œuvre des plans complexes et interdisciplinaires et initiatives de projet en fournissant des approches de gestion de projet. Les compétences et les connaissances de gestion de projet entrent dans la gamme générale et sont applicables à des projets dans son ensemble.\n\nCette position relève habituellement d’une organisation N4 ou plus haut.\n\n\nLe travail en général:\n\n‐ Diriger la conception, l’élaboration, la coordination et la mise en œuvre de plans de projet et d’initiatives complexes et interdisciplinaires ou l’élaboration de plans stratégiques et de plans opérationnels intégrés, de rapports et d’exposés de principe.\n\n‐ Relève habituellement de l’AS‐06 – Gestionnaire de projet. S’il n’y a pas d’AS‐06, l’AS‐05 peut relever directement de la direction (EX moins 1 ou plus ou l’équivalent).\n\n‐ Supervise le travail du personnel subalterne et fournit des directives fonctionnelles au personnel en ce qui concerne les projets.\n\n‐ Supervise les employés de niveau AS‐04, AS‐03, AS‐02 ou AS‐01 ou d’une combinaison de ces niveaux.\n\n‐ Peut avoir des employés subalternes d’autres groupes (p. ex. CR).\n\n‐ Plus d’un poste d’AS‐05 – Coordonnateur de projets peut être créé au sein du modèle structurel du sousvolet Projets et planification stratégique ‐ Projets.\n\nRemarque : Il ne faut pas confondre les modèles structurels et les organigrammes. Ces derniers illustrent une organisation comprenant des postes de tous les groupes fonctionnels au sein d’une organisation donnée alors que les modèles structurels représentent la structure des DTG dans un volet générique.\nL’emploi de l’expression « EX‐01/EX‐02 ou plus, ou l’équivalent » sert de référence structurelle.\n"};

