dbRow = {Title:"Officier – Soutien de la Flotte", WDNumber:"59731", Salary:"$62556 - $71124", Supervisory:"No", Classification:"GT-04", Link:"DND-TC-60170", Desc:"Le titulaire du poste sujet (PS) est chargé d’exécuter les activités de planification de la flotte à l’appui du commandant de la formation et de la Marine royale canadienne (MRC). Ces tâches d’importance primordiale consistent à faciliter l’élaboration du calendrier de la flotte et à formuler des recommandations à l’intention de la haute direction à l’appui des plans et des activités opérationnels. Cela comprend la coordination des exigences et l’analyse des répercussions des lacunes techniques, la formation et la disponibilité du personnel lorsqu’il reçoit des demandes de modification du calendrier, la coordination de toutes les visites portuaires et des demandes de dédouanement des unités de la flotte dans d’autres pays et des navires de guerre étrangers au Canada, la contribution à l’élaboration et à la révision des manuels opérationnels et le soutien dans les situations d’urgence.\n\nLe travail est habituellement effectué au sein d’une organisation de niveau C des opérations de la Flotte canadienne (CANFLT) et relève généralement d’un poste GT de niveau supérieur ou d’un poste militaire. Le titulaire de poste n’a aucune responsabilité de supervision.\n\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Officier contrôleur des champs de tir B6 (24+) ", WDNumber:"59720", Salary:"$70213 - $79832", Supervisory:"Yes", Classification:"GT-05", Link:"DND-TC-60161", Desc:"Le ou la titulaire du poste sujet (PS) gère et administre les opérations et l’utilisation quotidiennes des champs de tir et secteurs d’entraînement (CTSE) d’une base des Forces canadiennes (BFC). Le terme CTSE désigne un secteur d’entraînement militaire qui est utilisé par le personnel des Forces canadiennes (FC), des organismes locaux (GRC ou police) et des utilisateurs récréatifs (des particuliers). Le ou la titulaire du PS gère et administre la sécurité et les opérations des champs de tir par l’intermédiaire de superviseurs subalternes.\n\nLe PS est considéré comme un chef de sous-section et il ou elle rend directement compte au chef de section, qui est en dernier ressort responsable de la supervision des opérations quotidiennes des CTSE et qui est l’autorité technique responsable des activités, des exceptions aux règlements et de l’approbation des projets et des plans applicables aux CTSE.\n\nLe travail est exécuté conformément à la directive générale, selon laquelle le ou la titulaire du PS recommande des projets et des plans ainsi que des ordres courants de sécurité des champs de tir (OCSCT) pour que le chef de section les approuve. Le ou la titulaire du PE doit formuler des recommandations en prévision des périodes de pointe et des périodes de fluctuation. Les recommandations sont présentées au chef de section, qui les examine, avant d’être envoyées au commandant pour que celui ci les approuve.\n\nLe ou la titulaire du PS gère et administre la sécurité et les opérations des champs de tir par l’intermédiaire de superviseurs subalternes et les superviseurs des sous-unités en question gèrent des sous-unités qui incluent (sans toutefois s’y limiter) les suivantes.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Officier contrôleur supérieur des champs de tir C6 (24+) ", WDNumber:"59721", Salary:"$77700 - $88748", Supervisory:"Yes", Classification:"GT-06", Link:"DND-TC-60162", Desc:"Le ou la titulaire du poste sujet (PS) gère et supervise les opérations et l’utilisation quotidiennes des champs de tir et secteurs d’entraînement (CTSE) de deux bases des Forces canadiennes (BFC) ou plus. Le terme CTSE désigne un secteur d’entraînement militaire qui est utilisé par le personnel des Forces canadiennes (FC), des organismes locaux (GRC ou police) et des utilisateurs récréatifs (des particuliers). Le ou la titulaire du PS gère et supervise la sécurité et les opérations des champs de tir par l’intermédiaire de superviseurs subalternes.\n \nLe ou la titulaire du PS est considéré comme un chef de section et est l’autorité technique responsable des activités, des exceptions aux règlements et de l’approbation des projets et des plans applicables aux CTSE (par exemple les projets d’infrastructures, de construction et de déconstruction). Le ou la titulaire du PS rend directement compte au directeur, qui est un commandant (cmdt) du N4 ou une personne d’un niveau supérieur qui est en dernier ressort responsable des opérations quotidiennes des CTSE et qui est l’autorité de dernière instance relativement à tout ce qui concerne l’utilisation et les ressources des champs de tir.\n\nLe travail est exécuté conformément à la directive générale, selon laquelle le ou la titulaire du PS a le pouvoir d’élaborer et d’approuver des projets et des plans ainsi que des ordres courants de sécurité des champs de tir (OCSCT) et a pour responsabilité de veiller à ce que les ressources nécessaires soient disponibles pendant les périodes de pointe et les périodes de fluctuation.\n\nLe ou la titulaire du PS gère et supervise la sécurité et les opérations des champs de tir par l’intermédiaire de superviseurs subalternes et les superviseurs des sous-unités en question gèrent des sous-unités qui incluent (sans toutefois s’y limiter) les suivantes.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Officier responsable de la planification de la flotte - B1 (1-3)", WDNumber:"59733", Salary:"$70213 - $79832", Supervisory:"Yes", Classification:"GT-05", Link:"DND-TC-60172", Desc:"Le titulaire du poste sujet (PS) est chargé d’exécuter les activités d’établissement des calendriers de la flotte à l’appui du commandant de la formation et de la Marine royale canadienne (MRC). Ces tâches d’importance primordiale consistent à faciliter l’élaboration du calendrier de la flotte et à formuler des recommandations à l’intention de la haute direction à l’appui des plans et des activités opérationnels. Cela comprend l’analyse des répercussions des lacunes techniques, la formation et la disponibilité du personnel lorsqu’il reçoit des demandes de modification du calendrier, le suivi continu des capacités des ressources de la flotte pour fournir des conseils aux clients au sujet du rendement et de l’efficacité, la contribution à l’élaboration et à la révision des manuels opérationnels, le soutien dans les situations d’urgence, et la supervision du personnel.\n\n\nLe travail est habituellement effectué au sein d’une organisation de niveau C des opérations de la Flotte canadienne (CANFLT) et relève généralement d’un poste de niveau supérieur civil ou d’un poste militaire. Le titulaire du poste a une responsabilité de supervision continue.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Préposé à l'accueil", WDNumber:"0000057778", Salary:"$57430 - $61877", Supervisory:"No", Classification:"AS-02", Link:"DND-PA-58438", Desc:"Le poste existe au sein du Bureau de l’ombudsman et est chargé d’exercer des activités d’accueil et de gestion de plaintes et de demandes de renseignements reçues des personnes pouvant avoir recours aux services du Bureau, c’est-à-dire un membre actif ou à la retraite des Forces armées canadiennes (FAC); un membre actif ou un ex-membre des Cadets; une personne qui présente une demande d’enrôlement; un employé ou un ex employé du MDN; un employé ou ex-employé des fonds non publics; un membre de la famille immédiate des personnes susmentionnées et une personne qui est affectée aux FAC ou détachée auprès de celles-ci. Le poste détermine si les plaintes et les demandes de renseignements relèvent du Bureau et aiguille les personnes vers des services appropriés. Le poste constitue le premier niveau de réponse aux plaintes qui relèvent du Bureau en effectuant des recherches et des évaluations ainsi qu’en dirigeant les personnes pouvant avoir recours aux services du Bureau vers les mécanismes appropriés.\n\nLe poste relève d’un poste d’au moins deux niveaux hiérarchiques supérieurs.\n\nLe poste n’a pas de supervision continue. \n"};

