dbRow = {Title:"Superviseur/superviseure du bureau de service", WDNumber:"59598", Salary:"$70439 - $86213", Supervisory:"Yes", Classification:"CS-02", Link:"DND-CS-60047", Desc:"Le ou la titulaire du poste est responsable de la supervision et de la surveillance des opérations quotidiennes attitrées à l’équipe du bureau de service. \n\nUn centre de gestion des services (CGS) est une organisation de services de TI qui résulte du regroupement de nombreux points de services de TI (bureaux de service et fournisseurs de services) en une seule organisation de niveau un (N1) qui fournit des services à ses clients attitrés. Le CGS répond aux besoins du MDN et des FAC afin de fournir des services de TI efficients, efficaces et adaptés en recourant à une approche d’entreprise qui comprend un modèle de prestation de services optimisé, des centres de prestation des services de TI simplifiés ainsi que des outils et des processus uniformisés. En outre, il facilite l’établissement de niveaux mesurables de la prestation des services de TI, en fournissant au commandant des renseignements exacts qui permettent à ce dernier d’être bien informé de la situation et de prendre des décisions en ce qui a trait aux investissements du Ministère en matière de TI.\n\nLa principale responsabilité de la première ligne de soutien – le bureau de service – est l’initiation, l’exécution et la supervision dans le cas des demandes ayant trait à des incidents et à certains services.\n\nChaque bureau de service est chargé de la supervision et de l’exécution des éléments suivants :\n\nGestion des incidents\nGestion des demandes de service\nAcheminement des incidents, des demandes de service et des questions qui pourraient exiger une plus grande attention au palier hiérarchique approprié\nCommunications avec la communauté des utilisateurs finaux\n\nLe ou la titulaire du poste relève généralement d’un niveau E ou supérieur, et supervise de 4 à 10 employés de niveau subalterne.\n\n*Seulement pour utilisation au sein d’un Centre de gestion des services (CGS) relevant de l’initiative du Programme de gestion des services de technologie de l’information (GSTI)."};

