dbRow = {Title:"Technicien(enne) de soutien, Opérations d’infrastructure Operations", WDNumber:"59299", Salary:"$56907 - $73333", Supervisory:"No", Classification:"CS-01", Link:"DND-CS-59779", Desc:"1. No. de poste: GNCS010001\n\n2. S’applique au: Volet de travail de l’Infrastructure / Opérations\n\n3. Situation organisationnelle:\n\n4. Relève de: Chef d’équipe, Infrastructure / Opérations (GNCS030006 ou GNCS031006)\n\n5. Surveillance: S/O\n\n6. Lieu: Ce travail fait partie d’une organisation de technologie de l’information (TI) centralisée et, ainsi, contribue à la prestation de service en matière de TI pour l’ensemble de l’organisation. Il peut donc fonctionner partout où l’organisation a des activités.\n\n7. Commentaires généraux: Aucun\n"};

