dbRow = {Title:"Technicien/technicienne des postes de travail", WDNumber:"58894", Salary:"$29.08  - $37.48", Supervisory:"No", Classification:"CS-01", Link:"DND-CS-59446", Desc:"Le ou la titulaire du poste offre des services de gestion de l’information et technologie de l’information (GI-TI) au personnel du ministère de la Défense nationale (MDN) et des Forces armées canadiennes (FAC) par l’intermédiaire d’une organisation de prestation de services comme la Direction de la coordination de la gestion des services (CGS).\n\nUne CGS est une organisation de services de TI qui résulte du regroupement des nombreux points de services de TI (bureaux de services et fournisseurs de services) en une seule organisation de niveau un (N1) qui fournit les services à ses clients désignés. La CGS répond aux besoins du MDN et des FAC et doit fournir des services de TI efficients, efficaces et adaptés en recourant à une approche d’entreprise comprenant un modèle optimisé de prestation des services, des centres rationalisés de prestation des services de TI ainsi que des outils et des processus uniformisés. Elle facilite également l’établissement de niveaux mesurables de la prestation des services de TI, fournissant à un commandant l’information exacte aux fins de sa connaissance de la situation et de sa prise de décisions en ce qui a trait aux investissements du Ministère en matière de TI.\n\nCette fonction de soutien informatique assure le soutien de tous les utilisateurs dans la zone couverte par la CGS en ce qui concerne les fonctions sous-jacentes, notamment le matériel du poste de travail local et les périphériques utilisés pour accéder à toutes les applications et à tous les services autorisés. Elle veille à la livraison et à l’entretien des postes de travail et des périphériques, y compris les ordinateurs portatifs, les écrans et les imprimantes.\n\nDe plus, la fonction informatique offre du soutien aux activités de gestion du cycle de vie du matériel informatique et d’investissement permanent.\n\nLe ou la titulaire de poste relève généralement d’un niveau F ou supérieur et ne se voit attribuer aucune responsabilité de supervision.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Technologue principal en électronique ", WDNumber:"59625", Salary:"$73506 - $90187", Supervisory:"Yes", Classification:"EL-06", Link:"DND-EL-60071", Desc:"Le titulaire de ce poste est responsable de l'exécution de tâches et de services liés au génie électrique et électronique, au soutien technique, à la conception, à la mise au point, aux essais, à la production et à l'exploitation de l'équipement et des systèmes électriques et électroniques. \n\nCe poste ne comporte pas de responsabilité importante de supervision d’employés subalternes. \n\nEn règle générale, le poste relève d'un gestionnaire supérieur d'EL, d'un employé supérieur du groupe EN-ENG ou d'un gestionnaire militaire.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Technologue principal en électronique gestionnaire de programme", WDNumber:"59166", Salary:"$80532 - $98333", Supervisory:"Yes", Classification:"EL-07", Link:"DND-EL-60064", Desc:"Le titulaire du poste sujet (PS) est responsable de la gestion des programmes d’installation et d’entretien des systèmes et des équipements électroniques dans une zone géographique de responsabilité, et de l’exécution des tâches et services connexes en génie électrique et électronique, qui comprennent la conception, l’élaboration, le soutien technique, les mises à l’essai, la production et l’exploitation sécuritaire, ainsi que la rentabilité. \n\nLe titulaire de ce poste supervise des équipes multidisciplinaires, qui se trouvent habituellement à divers endroits, par l’entremise de superviseurs subalternes. \n\nEn règle générale, le poste relève d’un gestionnaire supérieur d’EL, d’un employé supérieur du groupe EN ENG ou d’un gestionnaire militaire. \n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Technologue superviseur en systèmes électroniques", WDNumber:"59617", Salary:"$66605 - $81666", Supervisory:"Yes", Classification:"EL-05", Link:"DND-EL-60063", Desc:"Le titulaire du poste sujet (PS) est chargé d’exécuter les tâches assignées dans le domaine de l’installation et de la réparation d’équipement électronique, de l’entretien et de la mise à jour de matériel et de systèmes de communication. La majeure partie du travail s’effectue dans un atelier ou un bureau; il faut aussi travailler sur le terrain, installer de l’équipement et des systèmes dans d’autres édifices du gouvernement du Canada, et le poste peut nécessiter de voyager à l’étranger. \n\nCe poste supervise les employés subalternes.\n\nHabituellement, ce poste relève d’un poste de niveau supérieur d’EL ou d’un poste militaire. \n"};

