exports.getPromotionStep = function(args){
    console.log(selectedSubClass[1]);
    console.log(selectedTargClass[1]);
    //Get all steps from substantive
    var dbReturn = getFromDataBase();
    var currentSalary = null;
    var classSubStepInfo = [];
    var classTargStepInfo = [];
    var maxDif = null;
    var targetStep = 1;
    var targetSalary = 0;
    //get substantive class step info
    for(i=0; i < dbReturn.length; i++){
        if(dbReturn[i].classCode == selectedSubClass[1]){
            classSubStepInfo.push(dbReturn[i]);
        }
    }
    //check differences
    for(i=1; i < classSubStepInfo.length; i++){
        var curDif = 0;
        curDif = classSubStepInfo[i].annually - classSubStepInfo[i-1].annually;
        //console.log(curDif);
        if(curDif > maxDif || maxDif == null){
            maxDif = curDif;
        }
        if(classSubStepInfo[i-1].step = selectedSubStep){
            currentSalary = classSubStepInfo[i-1].annually;
        }else if(classSubStepInfo[i].step = selectedSubStep){
            currentSalary = classSubStepInfo[i].annually;
        }
    }
    //get target class step info
    /* for(i=0; i < dbReturn.length; i++){
        if(dbReturn[i].classCode == selectedTargClass[1]){
            classTargStepInfo.push(dbReturn[i]);
        }
    } */
    //get target class step info
    for(i=0; i < dbReturn.length; i++){
        if(dbReturn[i].classCode == selectedTargClass[1]){
            classTargStepInfo.push(dbReturn[i]);
        }
    }
    //check steps
    for(i=0; i < classTargStepInfo.length; i++){
        if(currentSalary + maxDif < classTargStepInfo[i].annually){
                targetStep = classTargStepInfo[i].step;
                targetSalary = classTargStepInfo[i].annually;
                break;
        }
    }
    console.log(currentSalary);
    console.log(targetStep);
    resultLabel = `${selectedSubClass[1]} > ${selectedTargClass[1]} = Échelon: ${targetStep} | $${targetSalary}`;
    pageData.set("ResultLabel", resultLabel);
};
