dbRow = {Title:"Coordinator of Range Safety and Bookings (B5)", WDNumber:"60160", Salary:"$62556 - $71124", Supervisory:"Yes", Classification:"GT-04", Link:"DND-TC-60160", Desc:"The subject position (SP) is responsible for conducting analysis of ballistic trace patterns to approve Life Fire Safety Traces for users requesting use of the Range Training Area (RTA). This involves analyzing the RTA user’s submitted Danger Area Template to ensure scale of the Danger Area Overlay/Danger Area Trace respects the firing ricochet of each specific weapon and ammunition being used by the RTA user. The RTA is a military training area which is used by Canadian Force (CF) personnel, local agencies (RCMP/Police), and recreational users (members of the public). \n\nThe subject position typically reports directly to the Range Control Officer (RCO) which is responsible for and maintaining the day-to-day operations/usage of the Range Training Area (RTA).\n\nThe SP oversees range safety through subordinate supervisors responsible for patrolling the RTA and through the authorization Life Fire Safety Traces when booking/deconflicting the RTA.\n\nThe following Number of Employees degree can be applied without impacting the overall level:\n\nDegree Points Total Factor Rating\nB6 (24+ subordinates) 71 pts 452 pts\n\n\nAdditional Information\n\nDanger Area - The area associated with a range from which unauthorized ships, personnel, equipment and aircraft are excluded for reasons of safety either because of the actual firing of weapons, their effects or the presence of unexploded ordnance. \n\nDanger Area Template - Each specific weapon and ammunition combination has a distinct danger area template. This template is the area outlining the danger area of a single weapon firing that ammunition on a fixed line. \n\nDanger Area Overlay / Danger Area Trace - A design drawn on clear plastic (overlay) to the same scale as the exercise map, showing the total weapon danger areas within which one or more targets can be engaged by one or more weapons from stipulated firing areas.\n"};

