dbRow = {Title:"Desktop Technician ", WDNumber:"59446", Salary:"$29.08  - $37.48", Supervisory:"No", Classification:"CS-01", Link:"DND-CS-59446", Desc:"The position provides IM/IT Desktop services to DND/CAF staff within a service delivery organization such as an SMC.\n\nAn SMC is an IT services organization resulting from the consolidation of multiple IT points of service (service desks and service providers) into a single Level One organization (L1) that provides services to its assigned clients. The SMC addresses the needs of the DND/CAF to ensure efficient, effective, and responsive IT service delivery by establishing an enterprise-wide approach including an optimized service delivery model, streamlined IT service provision centres and standardized tools and processes. It also facilitates the establishment of measurable levels of IT service delivery, providing accurate information for a commander’s situational awareness and decision making with respect to the Department’s IT investments.\n\nThe Desktop Support function provides support to all users within the area covered by the SMC for the underlying capabilities, including the local physical workstation hardware and peripherals used to access all authorized applications and services. It ensures the delivery and maintenance of the workstations and peripherals, including items such as laptops, monitors, and printers.\n\nIn addition, the Desktop function provides support to Evergreening and Desktop Life Cycle Material Management activities\n\nThe position generally reports to a Level F or above and has no supervisory responsibilities.\n"};

databaseReturn.push(dbRow);

