dbRow = {Title:"Manager, Planning (11-25 Intermediate)", WDNumber:"59907", Salary:"$94121 - $107619", Supervisory:"Yes", Classification:"AS-07", Link:"DND-PA-59907", Desc:"The duties of primary importance of the subject position (SP) are to lead the development of strategic and business / operational plans for the organization / programs.\n\nThe role primarily deals with the internal planning of government programs and activities. While there is some need for socio-economic knowledge and analysis when doing some environmental or external scans and contributing to the development of methodologies to analyze socio-economic information, the SP is not involved in any in-depth or comprehensive research and analysis that would critically require the application of a comprehensive knowledge of economics, Sociology or statistics to the conduct of economic, socio-economic or sociological research, studies, forecasts, surveys or the development, application and evaluation of statistical or survey methods and indicators or the development, analysis and interpretation of qualitative and quantitative information. \n\nThe subject position reports to a more senior position. \n\nThe subject must continuously supervise subordinates. \n\nTypically, this position leads the development of plans for a Level 1 organization. \n\nThe following Supervision factors can be applied without impacting other ratings and the overall group and level: \n\nSupervision Factor Total Points SJD\nA1 (17) 716 \nA2 (33) 732 DND-PA-59679\nA3 (50) 749 DND-PA-59716\nB1 (37) 736 \nB2 (53) 752 \nC3 (90) 789 DND-PA-59777\n\nShould a Classification Decision be required with a supervision rating as listed above, please communicate with +SJD Funct Dir – Dir fonct DEN@ADM(HR-CIV) DCCO\n"};

