dbRow = {Title:"Senior Range Control Officer ", WDNumber:"60162", Salary:"$77700 - $88748", Supervisory:"Yes", Classification:"GT-06", Link:"DND-TC-60162", Desc:"The subject position (SP) manages and oversees the day-to-day operations/usage of 2 or more Canadian Force Base (CFB) Range Training Areas (RTA). The RTA is a military training area which is used by Canadian Force (CF) personnel, local agencies (RCMP/Police), and recreational users (members of the public). The SP manages and oversees the provision of range safety and range operations through subordinate supervisors.\n\nThe SP is considered a Section Head and is the technical authority for activities, regulation exceptions, and approval of RTA projects/plans (such as infrastructure/construction/deconstruction projects). The SP reports directly to the Branch Head, which is a L4 Commanding Officer (CO) or higher who is ultimately accountable for the day-to-day operations of the RTA and is the final authority for all matters related to range usage and resources. \n\nThe work is performed according to general instruction, where the SP has the authority to develop and approve projects/plans and Daily Range Standing Orders and is accountable for ensuring resources are available for peak periods and periods of fluctuations.\n\nThe SP manages and oversees the provision of range safety and range operations through subordinate supervisors, these sub-unit supervisors manage sub-units such as (but not limited to):\n\n Sub-unit Roles\nATS Unit Responsible for technical support and operation of the ATS Range\nEOD Unit Responsible to safely explode dud ammunition used in training\nRange Maintenance Unit Responsible for seasonal range workers. The unit is responsible to maintain the range to standard (appearance, cleanliness, repair of facilities, and brush clearing). The unit provides personnel to staff four forest tower lookouts for the peak training (and fire) season (1 April to 31 October) and for wildfire control support\nAdmin Support Unit Responsible for financial, human resources, forms/information maintenance, logistical support for the organization of booking conferences and other administrative requirements. This unit also houses the Target Shop which builds targets (human, tanks), huts and other required training aids.\nAccommodations Provides field camp accommodations, kitchen facilities, an “A” Echelon support site for all courses in the RTA, and 24/7 medical first response to users of the RTA\nRWN Ops Provides hourly assessment of forest fire hazard & environmental risk factors such as the Wet Bulb Index, Wind chill and Fire Warning Index. (note) Environment Canada shares information from these sites, in order to provide Canadians and the JMC with weather data;\nSafety & Booking Unit Responsible for booking RTA use, identifying RTA scheduling conflicts, producing DRSOs, enforcing RSO and DND security restrictions; acting as Emergency First Responders on the RTA (including monitoring and ordering ambulance response); and confirming on-site adherence to safety requirements and report violations. The unit also acts as a 24/7 communication centre and is responsible for non-complex live mapping of exercise ammunition trace patterns, users; authorization for live fire.\n* note the SP may manage sub-units not explicitly mentioned above.\n\nAdditional Information\n\nDanger Area - The area associated with a range from which unauthorized ships, personnel, equipment and aircraft are excluded for reasons of safety either because of the actual firing of weapons, their effects or the presence of unexploded ordnance. \n\nDanger Area Template - Each specific weapon and ammunition combination has a distinct danger area template. This template is the area outlining the danger area of a single weapon firing that ammunition on a fixed line. \n\nDanger Area Overlay / Danger Area Trace - A design drawn on clear plastic (overlay) to the same scale as the exercise map, showing the total weapon danger areas within which one or more targets can be engaged by one or more weapons from stipulated firing areas.\n"};

databaseReturn.push(dbRow);

dbRow = {Title:"Senior Service Desk Supervisor ", WDNumber:"60047", Salary:"$70439 - $86213", Supervisory:"Yes", Classification:"CS-02", Link:"DND-CS-60047", Desc:"The position is responsible for supervising and overseeing the daily operations of an assigned Service Desk Team. \n\nAn SMC is an IT services organization resulting from the consolidation of multiple IT points of service (service desks and service providers) into a single Level One organization (L1) that provides services to its assigned clients. The SMC addresses the needs of the DND/CAF to ensure efficient, effective, and responsive IT service delivery by establishing an enterprise-wide approach including an optimized service delivery model, streamlined IT service provision centres and standardized tools and processes. It also facilitates the establishment of measurable levels of IT service delivery, providing accurate information for a commander’s situational awareness and decision making with respect to the Department’s IT investments.\n\nThe primary responsibility of the 1st line of support, the Service Desk, is the initiation, execution and oversight of incidents and of some service requests.\n\nEach Service Desk is responsible for the oversight and/or execution of the following:\n\nIncident Management\nService Request Management\nEscalation of incidents, service requests and issues that may need higher attention and\nCommunications with the end user community\n\nThe position generally reports to a level E or above and supervises 4-10 employees at the junior level.\n\n*Only for use within a Service Management Centre (SMC) related to the ITSM initiative."};

